import React from "react";

import "./MsgTypes.css";

function MsgTypes(props) {
  let msgTypes = [
    "Screen Shot",
    "Is Typing",
    "Sending To Group",
    "Insert Image",
    "Voice Note",
    "External Chat",
  ];

  return (
    <div className="MsgTypes">
      <div
        className={"MsgTypes-name"}
      >
        <FilePicker
          msgType="Screen Shot"
          getScreenShotURL={props.getScreenShotURL}
        />
      </div>
      {msgTypes.map((value, index) => (
        <div
          id={"MsgTypes-id-" + index}
          className={"MsgTypes-name"}
          key={index}
          onClick={() => props.selectedMsgType ? props.selectedMsgType(value) : {}}
        >
          {value}
        </div>
      ))}
    </div>
  );
}

export default MsgTypes;
